"""# 3.Retrieval by Comparison

### instead to sent the big chunk into retriver and this is loss the resources and money we use this techniques

![image.png](data:image/png;base64,)
"""

def pretty_print_docs(docs):
    print(f"\n{'-' * 100}\n".join([f"Document {i+1}:\n\n" + d.page_content for i, d in enumerate(docs)]))

from langchain.retrievers import ContextualCompressionRetriever
from langchain.retrievers.document_compressors import LLMChainExtractor

"""### They are a lot shorter than the normal documents.
### We still have repeated sentences going on and this is because under the hood were using the semantic search algorithm. We solved this by using MMR from earlier in this lesson.
"""

compressor = LLMChainExtractor.from_llm(llm)
compression_retriever = ContextualCompressionRetriever(
    base_compressor= compressor,
    base_retriever = vectordb.as_retriever()
)

compressed_docs = compression_retriever.get_relevant_documents("what is the Awards in cv")

len(compressed_docs)

compressed_docs[0].page_content

compressed_docs[1].page_content

pretty_print_docs(compressed_docs)

"""# 4.Combining Various Retrieval Techniques"""

from langchain.retrievers.document_compressors import LLMChainExtractor
from langchain.retrievers import ContextualCompressionRetriever

compressor = LLMChainExtractor.from_llm(llm)
retriever = ContextualCompressionRetriever(
    base_compressor= compressor,
    base_retriever= vectordb.as_retriever(search_type="mmr")
)

final_result = retriever.get_relevant_documents("what is name of projects in cv")

len(final_result)

pretty_print_docs(final_result)

compressor = LLMChainExtractor.from_llm(llm)
retriever__f = ContextualCompressionRetriever(
    base_compressor= compressor,
    base_retriever= vectordb.as_retriever(search_type="mmr",filter={"source":"/content/Ahmed-MahmoudL-CVNl.pdf"})
)

final_result_f = retriever__f.get_relevant_documents("what is name of projects in cv")

len(final_result_f)

pretty_print_docs(final_result_f)

