"""# to enhance

##  Prompt Development for RetrievalQA
"""

template = """Use the following pieces of context to answer the question at the end. If you don't know the answer, just say that you don't know, don't try to make up an answer. Use three sentences maximum. Keep the answer as concise as possible. Always say "thanks for asking!" at the end of the answer.
{context}
Question: {question}
Helpful Answer:"""

from langchain.prompts import PromptTemplate

QA_CHAIN_PROMPT = PromptTemplate.from_template(template)

qa_chain_p = RetrievalQA.from_chain_type(
    llm=llm,
    retriever = vectordb.as_retriever(),
     return_source_documents=True,
    chain_type_kwargs = {"prompt":QA_CHAIN_PROMPT}
)

res_with_prompt= qa_chain_p({"query":qa})

res_with_prompt["result"]

res_with_prompt["source_documents"][0]

res_with_prompt["source_documents"][1]

"""# techniques to decrease provide the big context

# 1- RetrievalQA with Map Reduce & Refined Chain

### this methode provied each chunk context into llm and get summy from each
"""

qa_chain_m = RetrievalQA.from_chain_type(
    llm=llm,
    retriever = vectordb.as_retriever(),
    chain_type = "map_reduce"
)

res_with_map_reduce= qa_chain_p({"query":qa})

res_with_map_reduce["result"]

"""# Refined Chain

## this methode get summery from the chunk context and input it with the anthore chunk context in llm and and as on
"""

qa_chain_re_ch = RetrievalQA.from_chain_type(
    llm,
    retriever=vectordb.as_retriever(),
    chain_type="refine"
)
result_qa = qa_chain_re_ch({"query": qa})
result_qa["result"]

